import React from 'react';

class Item extends React.Component {
  render() {
    return (
      <li>{this.props.name}</li>
    )
  }
}

class App extends React.Component {

  constructor () {
    super()
    this.state = {
      data : ['Orange', 'Banana', 'Watermelon'],
    }
  }

  render() {
    return (
      <div>
        <h1>Hello React</h1>
        <ul>
          {this.state.data.map(name => (
            <Item name={name} />
          ))}
        </ul>
        <input type="text" ref={this.input}/>
      </div>
    )
  }
}

export default App;
